import React, {Component} from 'react';
import TaskOverview from "./TaskOverview";
import HandoverService from "./HandoverService";

class TasksBox extends Component {
    constructor(props) {
        super(props);

        this.state = {
            tasks: [],
            loading: true
        }
    }

    componentDidMount() {
        HandoverService.getUncompletedTasks().then((res) => {
            this.setState({tasks: res.data})
        // HandoverService.getUncompletedTasks()
        });
        this.setState({loading: false})
    }

    render() {
        if (this.state.loading) {
            return <div>...</div>
        }
        return (
            <div style={{background:  '#abdefb', margin: '50px', marginTop: '60px', padding: '2vh'}}>
                {
                    this.state.tasks.map(
                        task =>
                            <div> {task.patient.patientLocation} </div>
                            // <TaskOverview info={task} patient={task.patient}/>,
                            // console.log(task.id),
                    )
                }
                {/*<TaskOverview/>*/}
                {/*<TaskOverview/>*/}
            </div>
        );
    }
}

export default TasksBox;
